import React, { useState } from "react";

export const ChangeProfile = () => {
  const [newUsername, setNewUsername] = useState("");

  return (
    <div>
      <input
        placeholder="New Username"
        onChange={(event) => {
          setNewUsername(event.target.value);
        }}
      ></input>
      <button>Change Username</button>
    </div>
  );
};
